	('e20d4bfc-6515-4be1-95e2-646f9a7c1c95', '41ee5785-2d48-4f68-a307-d4636d114ab1', 'Entendimento do Fluxo de Caixa', 'ENTENDIMENTO_FLUXO_CAIXA', 'QUALITATIVE', 'EFICIENCIA', '', NULL, NULL, false, true, '2025-07-08 09:54:24.976399+00', '2025-07-08 09:54:24.976399+00', 'MANUAL', NULL, NULL, NULL, NULL, 10.00),
	('91783903-9db7-4c79-9ef7-bf88007db16e', '41ee5785-2d48-4f68-a307-d4636d114ab1', 'Dívida Estrutural/EBITDA', 'DIVIDA_EBITDA', 'QUANTITATIVE', 'ENDIVIDAMENTO', 'Capacidade de pagamento da dívida', 'SELECT COALESCE(total_debt.total, 0) / NULLIF(COALESCE(ebitda.value, 0), 0) FROM (SELECT SUM(COALESCE((fluxo_pagamento_anual->>${year})::decimal, 0)) as total FROM dividas_bancarias WHERE organizacao_id = $1) as total_debt, (SELECT receitas_agricolas - despesas_agricolas as value FROM projecao_fluxo_caixa WHERE organizacao_id = $1 AND ano = EXTRACT(YEAR FROM CURRENT_DATE)) as ebitda', 'ratio', true, true, '2025-06-28 13:47:53.864292+00', '2025-07-11 13:44:15.624664+00', 'CALCULATED', 'QUANTITATIVE', 'Indicadores Financeiros', NULL, NULL, 7.00),
	('eef62045-ca6c-425f-af8c-523e7a3637e4', '41ee5785-2d48-4f68-a307-d4636d114ab1', 'Liquidez Corrente', 'LIQUIDEZ_CORRENTE', 'QUANTITATIVE', 'LIQUIDEZ', 'Mede a capacidade de pagamento de curto prazo', 'SELECT COALESCE(SUM(caixa_bancos + clientes + adiantamentos_fornecedores + emprestimos_terceiros + estoque_defensivos + estoque_fertilizantes + estoque_almoxarifado + estoque_commodities + rebanho + ativo_biologico), 0) / NULLIF(COALESCE(SUM(valor), 0), 0) FROM projecao_caixa_disponibilidades WHERE organizacao_id = $1 AND ano = EXTRACT(YEAR FROM CURRENT_DATE)', 'ratio', true, true, '2025-06-28 13:47:53.864292+00', '2025-06-28 13:47:53.864292+00', 'CALCULATED', 'QUANTITATIVE', 'Indicadores Financeiros', NULL, NULL, 7.00),
	('18748b2b-f07b-461e-bd16-6792b130a3c9', '41ee5785-2d48-4f68-a307-d4636d114ab1', 'Margem EBITDA', 'MARGEM_EBITDA', 'QUANTITATIVE', 'RENTABILIDADE', 'Margem de lucro operacional', 'SELECT (COALESCE(ebitda.value, 0) / NULLIF(COALESCE(revenue.total, 0), 0)) * 100 FROM (SELECT receitas_agricolas - despesas_agricolas as value FROM projecao_fluxo_caixa WHERE organizacao_id = $1 AND ano = EXTRACT(YEAR FROM CURRENT_DATE)) as ebitda, (SELECT receitas_agricolas as total FROM projecao_fluxo_caixa WHERE organizacao_id = $1 AND ano = EXTRACT(YEAR FROM CURRENT_DATE)) as revenue', '%', true, true, '2025-06-28 13:47:53.864292+00', '2025-06-28 13:47:53.864292+00', 'CALCULATED', 'QUANTITATIVE', 'Indicadores Financeiros', NULL, NULL, 7.00),
	('06644c5d-2b6e-422f-bb98-34c65b49509b', NULL, 'Tendência de produtividade (5 anos)', 'TENDENCIA_PRODUTIVIDADE_5_ANOS', 'QUANTITATIVE', 'PRODUTIVIDADE', 'Analisa a tendência de produtividade nos últimos 5 anos', 'Calculado com base na regressão linear da produtividade média dos últimos 5 anos', '%', true, false, '2025-07-14 23:03:03.841689+00', '2025-07-14 23:03:03.841689+00', 'CALCULATED', 'QUANTITATIVE', 'Produtividade', NULL, NULL, 4.00),
